import {useState } from "react";
import './Form.css'


function Form () {    
    
	return (
		<section>
			<form action="">
				<fieldset>
					<input type="radio" id="" name="" value={''}/>
					<label htmlFor="">First option!</label>
					<input type="radio" id="" name="" value={''}/>
					<label htmlFor="">Second option!</label>
				</fieldset>
	
			</form>
		</section>
	)
}

export default Form;
